import base64
import os

ico_b64 = ""
ico_data = base64.b64decode(ico_b64)

icons_dir = "../src-tauri/icons"
if not os.path.exists(icons_dir):
    os.makedirs(icons_dir)

files = ["icon.ico", "32x32.png", "128x128.png", "128x128@2x.png", "icon.icns"]

for f in files:
    with open(os.path.join(icons_dir, f), "wb") as out:
        out.write(ico_data)
    print(f"Created {f}")
